Our &#39;Live Love Laugh Tricolor&#39; printed art sign makes a beautiful home decor item for that person in your family who you just absolutely adore. Art is printed onto our dark walnut or ebony stained pallet wood. (Example shown with ebony stain, 16.5x23&quot; board)

All Signs are Handmade, in Our Florida Shop.

*The backboard is made from 1/2&quot; thick pallet wood.
*Sign comes ready to hang with hardware installed.

Available in several sizes: 
10&quot; x 23&quot;
10.5&quot; x 23&quot;
16.5&quot; x 23&quot;

Each sign is made to order and may vary slightly from our sample photo.


 * Please use the Ask a Question button to ask any question you may have during the ordering process.
